import React, { useEffect, useState, useRef } from "react";
import { useAppSelector, useAppDispatch } from "../../store/hooks";
import { getVoiceToTextValue, updateLastTypedOrSelectedUserMessage, updateShowConfirmPrompt, updateLastActionPerformed } from "../../store/brenaSlice";
import { TextField } from "@mui/material";
import InputAdornment from "@mui/material/InputAdornment";
import SendIcon from "@mui/icons-material/Send";
import IconButton from "@mui/material/IconButton";
import "./ChatWidgetFooter.scss";
import { setActiveChatWidget, setIsVoiceSearchOn } from "../../store/brenaSlice";
import chatquestion from "../../img/Chat-question-outline.svg";
import voicebtn from "../../img/audio-button.svg";
import { useVoice } from "../../hooks/useVoice";
import BreadCrumbs from "../BreadCrumbs/BreadCrumbs";
import { useDetectDevice } from "../../hooks/useDetectDevice";

const ChatWidgetFooter = React.memo((props: any) => {
  const [typedVal, setTypedVal] = useState<any>("");
  const { isListening, listen, textObj } = useVoice();
  const textFieldRef = useRef<any>('');
  const [isMultiline, setIsMultiline] = useState(true);
  const [isTextInputFocused, setIsTextInputFocused] = useState(false);
  const textRef = useRef('');
  const device = useDetectDevice();

  const dispatch = useAppDispatch();
  const isPreviewBtnClicked = useAppSelector((state: any)=> state.brena.isPreviewBtnClicked);
  const lastActionPerformed = useAppSelector((state: any)=> state.brena.lastActionPerformed);
  const cursorPosRef = useRef(0);
  const [keepInputFocused, setKeepInputFocused] = useState(false);

  const activeChatWidget = useAppSelector(
    (state: any) => state.brena.activeChatWidget
  );
  const selectedChatMsg = useAppSelector(
    (state: any) => state.brena.selectedChatMsg
  );
  const breadCrumbsData = useAppSelector(
    (state: any) => state.brena.breadCrumbsData || []
  );
  const voiceToTextVal = useAppSelector(getVoiceToTextValue);
  useEffect(() => {
    setTypedVal(voiceToTextVal);
  }, [voiceToTextVal]);

  const onTextChange = (e: any) => {
    setTypedVal(e.target.value);
    textRef.current = e.target.value;
    cursorPosRef.current = e.target.selectionStart;
  };

  useEffect(() => {
    if (selectedChatMsg?.msg?.length) {
      //let updateInputVal = '';
      // if (typedVal?.length) {
      //   updateInputVal = typedVal + " " + selectedChatMsg.msg;
      // } else {
      //   updateInputVal = selectedChatMsg.msg;
      // }
      setTypedVal(selectedChatMsg.msg);
    }
    // eslint-disable-next-line
  }, [selectedChatMsg?.count]);

  useEffect(() => {
    if (textObj.interim_transcript) {
      if (cursorPosRef.current > 0) {
        const prevTxtAndVoice = textRef.current.substring(0, cursorPosRef.current) + ' ' +  textObj.interim_transcript + ' ';
        if (textObj.isFinal) {
          textRef.current = prevTxtAndVoice + textRef.current.substring(cursorPosRef.current);
          setTypedVal(textRef.current);
          textFieldRef.current?.children?.[0]?.children?.[0]?.setSelectionRange(prevTxtAndVoice.length, prevTxtAndVoice.length);
          cursorPosRef.current = prevTxtAndVoice.length;
        } else {
          setTypedVal(prevTxtAndVoice +  textRef.current.substring(cursorPosRef.current));
        }
        
        
      } else {
        if (textObj.isFinal) {
          textRef.current = textRef.current + ' ' + textObj.interim_transcript;
          setTypedVal(textRef.current);
        } else {
          setTypedVal(textRef.current + ' ' + textObj.interim_transcript);
        }
      }
    }
  }, [textObj]);
  useEffect(()=>{
    if (!isPreviewBtnClicked && lastActionPerformed?.type) {
        if (lastActionPerformed.type === 'new_chat') {
          onSendMessage(lastActionPerformed.content);
        } 
    }
  }, [isPreviewBtnClicked, lastActionPerformed])

  const onSendMessage = (val: any) => {
    if (isListening) {
      listen();//On send button click. stopping listen.
    }
    
    if (isPreviewBtnClicked) {
      dispatch(updateShowConfirmPrompt(true));
      dispatch(updateLastActionPerformed({type: 'send_message', content: val?.trim()}));
      return;
    }
    if (val?.trim()?.length ===0) {
      return;
    }
    if (val?.replace(/\n/g, "")) {
      dispatch(updateLastTypedOrSelectedUserMessage(val.trim()));
      if (!["recommend", "search", "chat"].includes(activeChatWidget)) {
        dispatch(setActiveChatWidget("chat"));
      }
      setIsMultiline(false);
      setTimeout(() => {
        setIsMultiline(true);
      }, 100);
    }
    setTypedVal("");
    textRef.current = '';
    dispatch(updateLastActionPerformed({type: '', content: ''}));

    if (device ==='brena-desktop') setKeepInputFocused(true);
  };

  const onVoiceSearch = () => {
    dispatch(setIsVoiceSearchOn(true));
    listen();
  };
  useEffect(()=> {
    if (activeChatWidget === 'chat_history') setKeepInputFocused(false);
  }, [activeChatWidget])

  useEffect(()=> {
    const handleClickOutside = (event: any) => {
      const brenaModal: any = document.getElementsByClassName('chat-widget-footer-text-box')?.[0];
      if (brenaModal && !brenaModal.contains(event.target)) {
        setKeepInputFocused(false);
      }
    };

    document.addEventListener('mousedown', handleClickOutside);

    return () => {
      document.removeEventListener('mousedown', handleClickOutside);
    };
  }, [])


  return (
    <div
      className={
        "chat-widget-footer " +
        (typedVal?.length > 0 || isListening
          ? "chat-widget-footer_focused"
          : "") + ' ' + device
      }
    >
      {breadCrumbsData.length > 0 ? (
        <BreadCrumbs></BreadCrumbs>
      ) : (
        <div className="chat-widget-footer-anything-else-block">
          <img src={chatquestion} className="Chat-question-cls" alt="Question"/> Is there
          anything else I can help you with?
        </div>
      )}
      <div className={"chat-widget-footer-text-voice-wrapper " + (isTextInputFocused && device === 'brena-tablet' ? ' show-full-width ': '' )}>
        <TextField
          className="chat-widget-footer-text-box"
          ref={textFieldRef}
          placeholder={isListening ? "Listening..." : "ask Brena anything..."}
          value={typedVal}
          inputRef={(input) => keepInputFocused ?  input && input.focus() : ''}
          onChange={(e: any) => onTextChange(e)}
          multiline={isMultiline}
          maxRows={3}
          onClick={(e)=> {
            const target: any = e.target;
            cursorPosRef.current = target.selectionStart;
          }}
          onFocus={(e)=> { 
            setIsTextInputFocused(true)}}
          onBlur={()=> setIsTextInputFocused(false)}
          onKeyDown={(e: any) => {
            if (e.keyCode === 13 && e.target.value?.trim()?.length > 0) {
              onSendMessage(e.target.value);
            }
          }}
          InputProps={{
            endAdornment: (
              <InputAdornment position="end">
                <IconButton
                  className="send-btn-cls"
                  edge="end"
                  onClick={() => {
                    onSendMessage(typedVal);
                  }}
                >
                  <SendIcon></SendIcon>
                </IconButton>
              </InputAdornment>
            ),
          }}
        />
        <div
          tabIndex={0}
          className={
            "chat-widget-footer-voice-btn " + (isListening ? "active" : "")
          }
          onClick={onVoiceSearch}
        >
          {!isListening && <img src={voicebtn} className="voicebtn-cls" alt="voice"/>}
          {isListening && (
            <img alt="voice"
              className="voicebtn-listen-cls"
              src="data:image/gif;base64,"
            />
          )}
        </div>
      </div>
    </div>
  );
});

export default ChatWidgetFooter;
